import React, { useState } from 'react';
import { Container, Row, Col, Form, Button, Card } from 'bootstrap/dist/css/bootstrap.min.css';

const CommunityPage = () => {
  const [questions, setQuestions] = useState([
    { id: 1, question: "How to install React Bootstrap?" },
    { id: 2, question: "What are the benefits of using React?" },
    { id: 3, question: "How to implement sorting in React?" }
  ]);

  const [filter, setFilter] = useState('');

  const handleFilterChange = (event) => {
    setFilter(event.target.value);
  };

  const filteredQuestions = questions.filter(
    question => question.question.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <Container>
      <Row className="mt-4">
        <Col>
          <h1>Community Page</h1>
        </Col>
      </Row>
      <Row className="mt-4">
        <Col>
          <Form.Group>
            <Form.Control 
              type="text" 
              placeholder="Search questions..." 
              value={filter} 
              onChange={handleFilterChange} 
            />
          </Form.Group>
        </Col>
      </Row>
      <Row className="mt-4">
        <Col>
          {filteredQuestions.map(question => (
            <Card key={question.id} className="mb-3">
              <Card.Body>
                <Card.Title>{question.question}</Card.Title>
                <Button variant="primary">View</Button>
              </Card.Body>
            </Card>
          ))}
        </Col>
      </Row>
    </Container>
  );
};

export default CommunityPage;
